var gdtw=function(e,t,n){var r=1,i=e(t[0],n[0]);while(t.length>1&&n.length>1){var s=e(t[1],n[0]),o=e(t[1],n[1]),u=e(t[0],n[1]),a=Math.min(s,o,u);switch(a){case s:t=_.rest(t);i+=s;break;case u:n=_.rest(n);i+=u;break;default:t=_.rest(t);n=_.rest(n);i+=o}r+=1}if(n.length===1){temp=n;n=t;t=temp}if(n.length!==1)for(var f=1;f<n.length;f++){i+=e(t[0],n[f]);r+=1}return i/r};